0:00","onSaleDates":[{"name":"On Sale","startDate":"2016-10-25 13:53:58","endDate":"2016-11-19 19:30:00"}],"topLineInfo":"Lola's Trailer","promoterName":"Lola's Trailer","sponsorName":"","sponsorImage":null,"additionalInfo":"","additionalTicketText":"","ageLimitCode":null,"ageLimit":"","showTypeCode":null,"showType":"","eventStatusCode":"BUY","eventStatus":"Buy","eventStatusMessage":"","ticketPurchaseUrl":"https://www.ticketfly.com/purchase/event/1373391?utm_medium=api","ticketPrice":"$10.00","externalTicketingUrls":[],"multiEventCartable":true,"facebookEventId":"","facebookEventIdString":"","headliners":[{"id":1386681,"name":"Charley Crockett","startTime":"2016-11-19 19:30:00","eventDescription":"Charley Crockett, a true descendant of Davy Crockett, was born in a poor town in deep South Texas. His early years were spent between Texas and Louisiana, raised by a blues singing single mother in Dallas, and an uncle who introduced him to the big brass sound of the French Quarter in New Orleans where he would later learn how to play guitar as a street performer. In 2009, Crockett showed up in New York City, where he made a living captivating subway car audiences for several years before being discovered and offered a record deal as part of the street group "Trainrobbers." Deciding to take his chances in a rapidly changing music industry, Charley declined the offer and headed west to California instead. Of mixed Jewish/White/Creole dissent, he has a unique sound blending a rich and diverse heritage of both new and traditional music. Crockett has been compared to many artists from Bill Withers and Jerry Lee Lewis to Dr. John and Citizen Cope. Elusive, rebellious and self taught, Crockett is a true street made original from earlier times.","isMobileFriendly":"false","image":{"jumbo":{"path":"http://cdn.ticketfly.com/i/00/01/84/91/51-atjmbo.jpg","width":960,"height":959},"jumbo1":{"path":"http://cdn.ticketfly.com/i/00/01/84/91/51-atjmbo1.jpg","width":960,"height":540},"large":{"path":"http://cdn.ticketfly.com/i/00/01/84/91/51-atlg.jpg","width":300,"height":300},"large1":{"path":"http://cdn.ticketfly.com/i/00/01/84/91/51-atlg1.jpg","width":300,"height":200},"medium":{"path":"http://cdn.ticketfly.com/i/00/01/84/91/51-atmd.jpg","width":200,"height":200},"medium1":{"path":"http://cdn.ticketfly.com/i/00/01/84/91/51-atmd1.jpg","width":200,"height":133},"original":{"path":"http://cdn.ticketfly.com/i/00/01/84/91/51-og.jpg","width":1086,"height":1085},"small":{"path":"http://cdn.ticketfly.com/i/00/01/84/91/51-atsm.jpg","width":100,"height":100},"small1":{"path":"http://cdn.ticketfly.com/i/00/01/84/91/51-atsm1.jpg","width":100,"height":67},"square":{"path":"http://cdn.ticketfly.com/i/00/01/84/91/51-sq.jpg","width":100,"height":100},"squareSmall":{"path":"http://cdn.ticketfly.com/i/00/01/84/91/51-sqsm.jpg","width":60,"height":60},"xlarge":{"path":"http://cdn.ticketfly.com/i/00/01/84/91/51-atxl.jpg","width":500,"height":500},"xlarge1":{"path":"http://cdn.ticketfly.com/i/00/01/84/91/51-atxl1.jpg","width":500,"height":334},"xxlarge":{"path":"http://cdn.ticketfly.com/i/00/01/84/91/51-atxxl.jpg","width":650,"height":649},"xxlarge1":{"path":"http://cdn.ticketfly.com/i/00/01/84/91/51-atxxl1.jpg","width":650,"height":433}},"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"https://www.reverbnation.com/charleycrockett","urlMySpace":"","urlFacebook":"https://www.facebook.com/charleycrockettmusic","urlTwitter":"","twitterScreenName":""}],"supports":[{"id":1386673,"name":"Vincent Neil Emerson","startTime":null,"eventDescription":""You can smell the heartache on my breath," declares singer-songwriter Vincent Neil Emerson on "Lady Luck," the opening tune of his new self-titled EP. More dramatically, you can hear the heartache loud and clear in this cherub-faced musician's extraordinary voice. Fitting somewhere between the nasal mournfulness of James Taylor and the cheeky self-awareness of Sufjan Stevens, Emerson has a beautiful, lilting delivery that, like his delicate and silky acoustic guitarwork, takes its time making a point but doesn't bore with that unhurried ease.

The EP offers a tasty plate of lo-fi coffeehouse folk-blues, just Emerson and his ax (barely) keeping each other company in a hushed studio. "Two Hearts" is even sadder than "Lady Luck," if that's possible, as Emerson ponders split personalities and wrecked romances. Believe it or not, tempo and mood start to pick up with the next tune, "Easy to Die" –– Emerson plays a series of quick repeating chords like chimes while he sighs, "I've been dreaming lately of the life I used to know / Where the world was an easy place to be."

The EP's slightly more upbeat closer, "Southern Belle," begins with the priceless couplet: "I fell in love with a nice young girl / Who came from hell." The aristocratic young Dixie woman in question spends a lot of time pondering whether Emerson is too much of a loser to bother with, but listeners know better. This young musician is a keeper, an artist with that rare ability to keep you hanging on every minor chord change and bluesy inflection. –– Jimmy Fowler (The Fort Worth Weekly}


"Less than a minute is all it takes for Fort Worth singer/songwriter Vincent Neil Emerson to make a powerful impression, singing of "smelling heartache on [his] breath" in Lady Luck, the first of four tracks found on his new eponymous EP.

Emerson's voice is backed by nothing more than acoustic guitar, but throughout this 13-minute showcase, the 22-year-old repeatedly demonstrates a flair for evoking life's extremes — love, death — in economical, emotional language. ( "Easy to Die" even packs a heartrending twist into its three and a half minutes: "Life can be so hard/But don't you close them eyes," Emerson pleads.) It's a striking collection, and one which suggests a star being born. " - Star Telegram","isMobileFriendly":"false","image":null,"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"https://www.reverbnation.com/vincentneilemerson1","urlMySpace":"","urlFacebook":"https://www.facebook.com/vincentneilemerson/timeline","urlTwitter":"http://twitter.com/vincentnemerson","twitterScreenName":"vincentnemerson"}],"urlEventDetailsUrl":"http://www.lolassaloon.com/event/1373391?utm_medium=api"}]}
